import React from 'react';

// This component is now much simpler. It no longer needs to know about
// expanded states, back arrows, or its position in the stack.
const Card = ({ card, onCardClick }) => {
  return (
    <li className="card" onClick={onCardClick}>
      <img src={card.imageUrl} alt={card.title} />
    </li>
  );
};

export default Card;
